import { __decorate } from "tslib";
import { Component } from '@angular/core';
let SearchBookComponent = class SearchBookComponent {
    constructor(databaseService) {
        this.databaseService = databaseService;
        this.displayedColumns = ['id', 'bookName', 'authorName', 'isbnNumber'];
    }
    async ngOnInit() {
        var data = await this.databaseService.getBooks().toPromise();
        this.books = data;
        console.log(data);
    }
};
SearchBookComponent = __decorate([
    Component({
        selector: 'app-search-book',
        templateUrl: './search-book.component.html',
        styleUrls: ['./search-book.component.scss']
    })
], SearchBookComponent);
export { SearchBookComponent };
